import React from "react";

class Books extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      books: []
    };
  }

  componentDidMount () {
    fetch("http://localhost:8080/file")
    .then (response => response.json())
    .then(data => this.setState({books}));
  }

  render() {
   return (
       {...books.map(book => (
        <image src={book} alt="test"></image>
       ))}
   );
  }
}

export default Books;
